Jake The Snake Roberts on Awesome Bomb Fight Radio!

The ultra legendary wrestling superstar Jake The Snake Roberts is coming on at a very special time to talk to your fight radio heroes Gaius Julius Sensei and Violence Jack... We are going to let Jack talk about all the classic WWF feuds that he has always wanted to know about as well as what Jake is up to now... the sideshow tour he went on, his opinion of current wrestling and if he is going to get in with a major company and shake up the world again!

We will also be hearing from Gary The Nightowl from St Louis based LWA later in the hour so he can tell us about the huge US vs. Them show coming up on the 15th in the STL area. LWA vs Ring Of Honor!

